import React, { useEffect } from 'react'
import { useDispatch } from 'react-redux';
import { getcourseError, getcourseLoading, getcourseSuccess } from '../../redux/staff/Actions';
import Staffnavbar from './Staffnavbar'
const StaffCourse = () => {
  const dispatch=useDispatch();
  let handlefetch=()=>{
    dispatch(getcourseLoading())
      axios({
        method: "get",
        url: 'http://localhost:8000/courseapi/course/',
    }).then((response)=>{
      dispatch(getcourseSuccess(response.data));
    }).catch((error)=>{
      dispatch(getcourseError());
      let errmessage=error.response.data.Email;
      alert("Error :"+errmessage);
    })
    }
    useEffect(()=>{
      handlefetch();
    },[])
  return (
    <>
    <Staffnavbar/>
    <div>

    </div>
    </>
  )
}

export default StaffCourse
